export const toc = [{
  value: 'Location schema',
  id: 'location-schema',
  children: []
}, {
  value: 'Get all quotes',
  id: 'get-all-quotes',
  children: []
}, {
  value: 'Sort the response',
  id: 'sort-the-response',
  children: []
}, {
  value: 'Limit the response',
  id: 'limit-the-response',
