  id: 'use-limit-with-sort',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`This is the documentation for the `}<inlineCode parentName="p">{`/quote`}</inlineCode>{` endpoint. There are currently `}<inlineCode parentName="p">{`51`}</inlineCode>{` quotes sorted by id.`}</p>
    <h3 {...{
      "id": "location-schema"
    }}>{`Location schema`}</h3>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Key`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Type`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`id`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`int`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The id of the quote (starting from 1).`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`quote`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Quote from Final Space.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`by`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Character who said the Quote.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`character`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string (url)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`URL to Character endpoint.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`image`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string (url)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Image of the Charater.`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "get-all-quotes"
    }}>{`Get all quotes`}</h3>
    <p>{`You can access the all the quotes by using the `}<inlineCode parentName="p">{`/quote`}</inlineCode>{` endpoint.`}</p>
    <pre><code parentName="pre" {...{}}>{`https://spaceapi.tech/api/v0/quote/
`}</code></pre>
    <pre><code parentName="pre" {...{
        "className": "language-json"
      }}>{`[
  {
    "id": 1,
    "quote": "How about fricken’ no?!",
    "by": "Space",
    "character": "https://spaceapi.tech/api/v0/character/1",
    "image": "https://spaceapi.tech/api/character/avatar/gary_goodspeed.jpg"
  },
  {
    "id": 2,
    "quote": "You see, I like that. I like a girl with a lot of phones.",
    "by": "Space",
    "character": "https://spaceapi.tech/api/v0/character/1",
    "image": "https://spaceapi.tech/api/character/avatar/gary_goodspeed.jpg"
  },

 ...
]
`}</code></pre>
    <h3 {...{
      "id": "sort-the-response"
    }}>{`Sort the response`}</h3>
    <p>{`You can now sort the response based on `}<inlineCode parentName="p">{`id`}</inlineCode>{` by passing the `}<inlineCode parentName="p">{`/?sort=asc`}</inlineCode>{` or `}<inlineCode parentName="p">{`/?sort=desc`}</inlineCode>{` query in the URL.`}</p>
    <pre><code parentName="pre" {...{}}>{`https://spaceapi.tech/api/v0/quote/?sort=desc
`}</code></pre>
    <pre><code parentName="pre" {...{
        "className": "language-json"
      }}>{`[
  {
    "id": 51,
    "quote": "Oh...okay... yeah... I think you are under arrest.",
    "by": "Chuck",
    "character": "https://spaceapi.tech/api/v0/character/23",
    "image": "https://spaceapi.tech/api/character/avatar/chuck.jpg"
  }
  ...
]
`}</code></pre>
    <h3 {...{
      "id": "limit-the-response"
    }}>{`Limit the response`}</h3>
    <p>{`You can limit the response by passing the `}<inlineCode parentName="p">{`/?limit={number}`}</inlineCode>{` query in the URL.`}</p>
    <pre><code parentName="pre" {...{}}>{`https://spaceapi.tech/api/v0/quote/?limit=3
`}</code></pre>
    <pre><code parentName="pre" {...{
        "className": "language-json"
      }}>{`[
  {
    "id": 1,
    "quote": "How about fricken’ no?!",
    "by": "Space",
    "character": "https://spaceapi.tech/api/v0/character/1",
    "image": "https://spaceapi.tech/api/character/avatar/gary_goodspeed.jpg"
  },
  {
    "id": 2,
    "quote": "You see, I like that. I like a girl with a lot of phones.",
    "by": "Space",
    "character": "https://spaceapi.tech/api/v0/character/1",
    "image": "https://spaceapi.tech/api/character/avatar/gary_goodspeed.jpg"
  },
  {
    "id": 3,
    "quote": "Let's get wild. How about you buy me a drink?",
    "by": "Space",
    "character": "https://spaceapi.tech/api/v0/character/1",
    "image": "https://spaceapi.tech/api/character/avatar/gary_goodspeed.jpg"
  }
]
`}</code></pre>
    <h3 {...{
      "id": "use-limit-with-sort"
    }}>{`Use limit with sort`}</h3>
    <p>{`You can limit and sort the response simultaneously by passing both `}<inlineCode parentName="p">{`limit={number}`}</inlineCode>{` and `}<inlineCode parentName="p">{`sort=desc`}</inlineCode>{` query parameters in the URL and seperating them with `}<inlineCode parentName="p">{`&`}</inlineCode>{` operator.`}</p>
    <pre><code parentName="pre" {...{}}>{`https://spaceapi.tech/api/v0/quote/?limit=3&sort=desc
`}</code></pre>
    <pre><code parentName="pre" {...{
        "className": "language-json"
      }}>{`[
  {
    "id": 51,
    "quote": "Oh...okay... yeah... I think you are under arrest.",
    "by": "Chuck",
    "character": "https://spaceapi.tech/api/v0/character/23",
    "image": "https://spaceapi.tech/api/character/avatar/chuck.jpg"
  },
  {
    "id": 50,
    "quote": "Yes, that's Chuck, now please surrender and this all goes away.",
    "by": "Chuck",
    "character": "https://spaceapi.tech/api/v0/character/23",
    "image": "https://spaceapi.tech/api/character/avatar/chuck.jpg"
  },
  {
    "id": 49,
    "quote": "Ergon, we have orders to arrest your for, uh..., grand theft.",
    "by": "Chuck",
    "character": "https://spaceapi.tech/api/v0/character/23",
    "image": "https://spaceapi.tech/api/character/avatar/chuck.jpg"
  }
]
`}</code></pre>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
